&lt;p&gt;&lt;strong&gt;Please allow up to 48 hours to receive your Kogan voucher via email after completing your swap.&lt;/strong&gt;&lt;/p&gt;

To use your gift card online, simply swap it for a Kogan.com voucher. Fill out your details, choose an amount between $30 - $100, and the Kogan.com voucher will be sent to your nominated email address. Once the swap is completed, the selected amount will be deducted from your physical gift card.

*An unlimited amount of Gift Card codes can be used per transaction on the Kogan.com website.

To use your gift card online, simply swap it for an Universal Store voucher. Fill out your details, choose an amount between $20 - $200, and the Universal Store voucher will be sent to your nominated email address. Once the swap is completed, the selected amount will be deducted from your physical gift card.

&lt;p&gt;&lt;strong&gt;Please note: The $50 Universal Store voucher is currently out of stock. We will be restocking soon!&lt;/strong&gt;&lt;/p&gt;

*Limit of 1 Gift Card code per transaction on the Universal Store website.
